import React from 'react'
import { CSVLink } from 'react-csv'

export const ExportReactCSV = ({csvData, fileName, headers}) => {
    return (

            <CSVLink headers={headers} data={csvData} filename={fileName}>Export To Excel</CSVLink>

    )
}
